import iconpagas from './assets/iconcobpagas.svg';
import iconprevistas from './assets/iconcobprevistas.svg';
import iconvencidas from './assets/iconcobvencidas.svg';
import './styles.css';

const ChargesResume = () => {
  return(
    <div className="card-resumo-alinhamento">
      <div className="card-resumo color-EEF6F6">
        <img src={iconpagas} alt="Icone Pagas"/>
        <div className="card">
          <h3>Cobranças Pagas</h3>
          <p>R$ 30.000</p>
        </div>
      </div>
      
      <div className="card-resumo color-FFEFEF">
        <img src={iconvencidas} alt="Icone Pagas"/>
        <div>
          <h3>Cobranças Vencidas</h3>
          <p>R$ 7.000</p>
        </div>
      </div>
      
      <div className="card-resumo color-FCF6DC">
        <img src={iconprevistas} alt="Icone Pagas"/>
        <div>
          <h3>Cobranças Previstas</h3>
          <p>R$ 10.000</p>
        </div>
      </div>
    </div>    
  ); 
};

export default ChargesResume;
